import BackBlogGround from './BackBlogGround'

class PrivateZone extends React.Component{

    constructor(props){
        super(props)
        this.state={}

    }

    render(){

        return(
            <BackBlogGround/>
        )
    }

}

export default withRouter(PrivateZone)
